import { Card, Deck} from './components'
import { Link } from "react-router-dom";

const flashCardDeck = Deck("","","");

function addCard(x,y){
    let addingCard = Card(x,y);
    flashCardDeck.currentCard = addingCard;
}


export default function Home() {

    const [question, setQuestion] = useState(" ");
    const [answer, setAnswer] = useState(" ");
  
    const updateQuestion = event => {
      setQuestion(event.target.value);
    };
    const updateAnswer = event => {
      setAnswer(event.target.value);
    };
      return (
        <>
        <div>
        <input  onChange={updateQuestion} placeholder = "Enter Question"/>
        <input  onChange={updateAnswer} placeholder = "Enter Answer"/>  
        </div>
        <button onClick={()=> addCard(question,answer)}> Button</button>
        <li>
          {/* Endpoint to route to Home component */}
          <Link to="/">Home</Link>
        </li>
        <li>
          {/* Endpoint to route to About component */}
          <Link to="/boobPage">boobPage</Link>
        </li>
        </>
      )
  }
